import PySimpleGUI as sg

IMAGE_ICON = ''


def gen_passcode(seed: str):
    num_seed = int(seed)
    num_seed = ((214013 * num_seed + 2531011) & 0x7fffffff)
    code = str(num_seed)
    code = code[:6]
    return code


VALID_INPUT = '0123456789'

SEED_KEY: str = '-SEED-'
GEN_KEY: str = '-GEN-'
PASS_KEY: str = '-PASS-'

layout = [[sg.Text('Enter seed 6 digit password seed from customer, then press Generate')],
          [sg.Text('Seed:'), sg.Input(key=SEED_KEY, enable_events=True, default_text='e.g: 142565', text_color='gray')],
          [sg.Button('Generate', key=GEN_KEY)],
          [sg.Text('After pressing generate, provide this passcode to the customer:')],
          [sg.Text('Code:'), sg.Input(key=PASS_KEY, readonly=True)]]

window = sg.Window(title='SNX Passcode Generator', layout=layout, icon=IMAGE_ICON)

while True:
    invalid_found = False
    event, values = window.read()
    print(event, values)
    if event in (sg.WIN_CLOSED, 'Exit'):
        break
    if event == SEED_KEY and values[SEED_KEY]:
        window[SEED_KEY].update(text_color='black')
        seed_string: str = values[SEED_KEY]
        idx = 0
        for char in seed_string:
            if char not in VALID_INPUT:
                seed_string = seed_string.replace(char, '')
            elif idx > 5:
                seed_string = seed_string[:-1]
            idx += 1
        window[SEED_KEY].update(seed_string)
    if event == GEN_KEY:
        if len(values[SEED_KEY]) < 6 or not values[SEED_KEY].isdigit():
            window[PASS_KEY].update('ERROR: Enter valid 6 digit numeric passcode seed.')
        else:
            window[PASS_KEY].update(gen_passcode(values[SEED_KEY]))
window.close()
